public class ResponsePlanFactory(string resourceName = null, Action<Humidifier.SSMIncidents.ResponsePlan> factoryAction = null) : ResourceFactory<Humidifier.SSMIncidents.ResponsePlan>(resourceName)
{

    internal List<InnerResponsePlanIntegrationFactory> IntegrationsFactories { get; set; } = [];

    internal List<InnerResponsePlanActionFactory> ActionsFactories { get; set; } = [];

    internal InnerResponsePlanChatChannelFactory ChatChannelFactory { get; set; }

    internal InnerResponsePlanIncidentTemplateFactory IncidentTemplateFactory { get; set; }

    protected override Humidifier.SSMIncidents.ResponsePlan Create()
    {
        var responsePlanResult = CreateResponsePlan();
        factoryAction?.Invoke(responsePlanResult);

        return responsePlanResult;
    }

    private Humidifier.SSMIncidents.ResponsePlan CreateResponsePlan()
    {
        var responsePlanResult = new Humidifier.SSMIncidents.ResponsePlan
        {
            GivenName = InputResourceName,
        };

        return responsePlanResult;
    }
    public override void CreateChildren(Humidifier.SSMIncidents.ResponsePlan result)
    {
        base.CreateChildren(result);

        result.Integrations = IntegrationsFactories.Any() ? IntegrationsFactories.Select(x => x.Build()).ToList() : null;
        result.Actions = ActionsFactories.Any() ? ActionsFactories.Select(x => x.Build()).ToList() : null;
        result.ChatChannel ??= ChatChannelFactory?.Build();
        result.IncidentTemplate ??= IncidentTemplateFactory?.Build();
    }

} // End Of Class

